import { Link } from "react-router-dom";

function Enlace1() {
  return (
    <>
      <p>
        Orientación Laboral y puesta en contacto con empresas del sector: Cv y
        LinkedIn De cara a diseñar el taller de Paola Salanueva y el feedback
        individual que os dará tras el taller necesitamos vuestros CV y enlaces
        a LinkedIn. Os pido por favor que enviéis un mail a marta@code4jobs.com
        antes del viernes que viene (16 de Octubre) con: el enlace a vuestra
        cuenta de LinkedIn. si tenéis, vuestro CV "clásico"(el de papel de toda
        la vida vaya) en el adjunto. No importa si no está actualizado a fecha
        de hoy.
      </p>
      <Link to="/Enlace2">Enlace 2</Link>
      <br />
    </>
  );
}
export default Enlace1;
